import React from 'react';
import styled from 'styled-components';

const HeroContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 80vh;
  background-color: #f5f5f5;
`;

const HeroTitle = styled.h1`
  font-size: 4rem;
  font-weight: bold;
  text-align: center;
  margin-bottom: 0.5rem;
`;

const HeroText = styled.p`
  font-size: 1.25rem;
  text-align: center;
  color: #777;
  margin-bottom: 1rem;
`;

const HeroButton = styled.button`
  background-color: #007bff;
  color: white;
  padding: 1rem 2rem;
  border: none;
  border-radius: 5px;
  font-size: 1rem;
  cursor: pointer;
`;

const HeroWatchButton = styled.a`
  display: flex;
  align-items: center;
  margin-top: 1rem;
  color: #007bff;
  text-decoration: none;
`;

const HeroWatchIcon = styled.i`
  margin-right: 0.5rem;
`;

const HeroSection = () => {
  return (
    <HeroContainer>
      <HeroTitle>World's first image to HTML converter</HeroTitle>
      <HeroText>
        Get the HTML CSS code of your project in no time! Al-Powered tool to
        create a website in few minutes.
      </HeroText>
      <HeroButton>Try now</HeroButton>
      <HeroWatchButton href="#">
        <HeroWatchIcon className="fas fa-play-circle"></HeroWatchIcon>
        See in action
      </HeroWatchButton>
    </HeroContainer>
  );
};

export default HeroSection;
